import React from "react";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Search from "./Search";

import Footer from "./Footer";

const Menu = () => {
  return (
    <>
      <Navbar />
      <Logo />
      <Search />
      <Footer />
    </>
  );
};
export default Menu;
